import React from 'react';
import './styles.scss';
import sidebarItems from './sidebarItems';
// import { Link } from 'react-router-dom';

const Sidebar = () => {
  return (
    <div className="sidebar-wrapper">
      <ul>
        {
          sidebarItems.map((item) => {
            return (
              <li key={item.name}>
                <div>
                  {console.log(item.icon())}
                  <span>{item.icon()}</span>
                </div>
              </li>
            );
          })
        }
      </ul >
    </div >
  );
};

export default Sidebar;
